</div><div class="site-inner"><div class="wrap"><div class="content-sidebar-wrap"><main class="content"><article class="post-996 post type-post status-publish format-standard has-post-thumbnail category-indie tag-azja-poludniowo-wschodnia tag-bezcenne-wspomnienia tag-bezpanskie-psy tag-bollywood tag-dieta-w-podrozy tag-ekologia tag-gory tag-hiking tag-himalaje tag-hinduizm tag-indie tag-lasie-w-trasie tag-magia-w-naturze tag-muzyka tag-na-szlaku tag-podroz tag-triund tag-wedrowka tag-why-not-travel tag-wschod-slonca tag-wynajmij-namiot tag-zachod-slonca tag-zupka-instant entry" itemscope="itemscope" itemtype="http://schema.org/BlogPosting" itemprop="blogPost"><header class="entry-header"><h2 class="entry-title" itemprop="headline"><a href="http://www.whynot-travel.pl/?p=996" rel="bookmark">NA&nbsp;SZLAKU W&nbsp;HINDUSKIM STYLU</a></h2>
<p class="entry-meta"><time class="entry-time" itemprop="datePublished" datetime="2016-12-14T13:56:25+00:00">14 grudnia 2016</time><span class="entry-categories"><a href="http://www.whynot-travel.pl/?cat=417" rel="category">INDIE</a></span> </p></header><div class="entry-content" itemprop="text"><p class="p1"><span class="s1">Spedzajac dwa tygodnie w&nbsp;jednym miejscu podczas kursu jogi, nie moglysmy doczekac sie weekendu, aby wyrwac sie na&nbsp;chwile w&nbsp;inny rejon. Jestesmy przeciez u&nbsp;podnoza Himalajow, jak tu nie zakosztowac trekingu w&nbsp;takich gorach?</span></p>
<p class="p1"><a href="http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog.jpg"><img class="aligncenter size-full wp-image-991" src="http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog.jpg" alt="DSC07306blog" width="3872" height="2592" srcset="http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog.jpg 3872w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog-747x500.jpg 747w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog-768x514.jpg 768w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog-250x167.jpg 250w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog-550x368.jpg 550w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog-800x536.jpg 800w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog-269x180.jpg 269w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07306blog-448x300.jpg 448w" sizes="(max-width: 3872px) 100vw, 3872px" /></a></p>
<p class="p1"><a class="more-link" href="http://www.whynot-travel.pl/?p=996">Read more</a></p>
</div><footer class="entry-footer"><p class="entry-meta"><div class='post-footer-line post-footer-line-2'> <span class="entry-comments-link"><a href="http://www.whynot-travel.pl/?p=996#respond">Leave a Comment</a></span> </div>  <div class='post-footer-line post-footer-line-3'>		  	<span class='post-sharing-icons'>  		<a class='facebook' href="https://www.facebook.com/sharer/sharer.php?u=&t=" title="Share on Facebook" target="_blank"><i class='fa fa-post-footer fa-facebook'></i></a> 	<a class='facebook' href="https://www.youtube.com/channel/UC2e7M5P-uW2qvmQKHcv7agA" title="Check on YT" target="_blank"><i class='fa fa-post-footer fa-youtube'></i></a> 	  		</i></a>           	</span>  </div></p></footer></article><article class="post-989 post type-post status-publish format-standard has-post-thumbnail category-indie tag-asana tag-azja tag-backpacker-life tag-backpacking tag-centrum-jogi tag-dalejlama tag-dharmakot tag-dharmasala tag-himalaje tag-himalayan-iyengar-yoga-centre tag-indie tag-iyengar tag-joga tag-kochamy-podroze tag-lasie-w-trasie tag-mcleod-ganj tag-podroz-z-plecakiem tag-podroz-zycia tag-praca-nad-cialem tag-przygoda-z-plecakiem tag-relaksacja tag-szesciotysieczniki tag-tybet tag-wakacje-na-3-tygodnie tag-yoga tag-z-biletem-w-reku entry" itemscope="itemscope" itemtype="http://schema.org/BlogPosting" itemprop="blogPost"><header class="entry-header"><h2 class="entry-title" itemprop="headline"><a href="http://www.whynot-travel.pl/?p=989" rel="bookmark">JAK LASIE TRAFILY DO&nbsp;INDII</a></h2>
<p class="entry-meta"><time class="entry-time" itemprop="datePublished" datetime="2016-12-05T20:28:25+00:00">5 grudnia 2016</time><span class="entry-categories"><a href="http://www.whynot-travel.pl/?cat=417" rel="category">INDIE</a></span> </p></header><div class="entry-content" itemprop="text"><p class="p1"><span class="s1">Mial byc Wietnam i&nbsp;Kambodza. Swego rodzaju dokonczenie rozdzialu naszej 7-miesiecznej przygody podrozniczej. Wtedy zabraklo mamony. Po&nbsp;szybkim odkuciu sie, od&nbsp;razu byl plan, aby dokonczyc co zaczelysmy. Potem przyszla chwila zastanowienia. Mamy &#8222;tylko&#8221; 3 tygodnie. Czy na&nbsp;pewno jestesmy w&nbsp;stanie zobaczyc przez ten czas tyle, ile chcemy? Wiedzialysmy juz z&nbsp;czym wiaze sie zycie w&nbsp;ciaglym biegu w&nbsp;podrozy. Nie do&nbsp;konca jestes wtedy w&nbsp;stanie poznac lokalne zycie i&nbsp;obyczaje, a&nbsp;wlasnie na&nbsp;tym najbardziej nam zalezy. Zabraklo tez ekscytacji &#8211; tego ucisku w&nbsp;zoladku na&nbsp;mysl o&nbsp;wyjezdzie. Ale&nbsp;przeciez gdzies jechac trzeba. No to&nbsp;palcem po&nbsp;mapie, a&nbsp;moze tak do&nbsp;Indii? Jeszcze przed&nbsp;wyjazdem z&nbsp;Polski przez dlugi czas praktykowalysmy joge. Moze wlasnie Indie &#8211; kolebka tej&nbsp;dziedziny, to&nbsp;dobry pomysl zeby&nbsp;do niej wrocic? Wiedzialysmy, ze&nbsp;potrzeba nam wytchnienia, odpoczynku. Nazbierania garsciami energii na&nbsp;dluga zime, jaka jest przed&nbsp;nami. Troche slonca, ale&nbsp;zadne tam wylegiwanie sie na&nbsp;plazy. Dlugo sie przekonywac nie musialysmy. Kierunek? Jedziemy do&nbsp;Indii!. Dlaczego? Z&nbsp;jednej strony nauka jogi u&nbsp;zrodla. Z&nbsp;drugiej jednak potrzebowalysmy tez malej odskoczni od&nbsp;samej Azji Poludniowo-Wschodniej. Bo przeciez tak fajnie jest poznawac nowe, inne kultury.</span></p>
<p class="p1"><a href="http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb.jpg"><img class="aligncenter size-full wp-image-984" src="http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb.jpg" alt="joga w&nbsp;Indiach" width="3872" height="2592" srcset="http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb.jpg 3872w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb-747x500.jpg 747w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb-768x514.jpg 768w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb-250x167.jpg 250w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb-550x368.jpg 550w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb-800x536.jpg 800w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb-269x180.jpg 269w, http://www.whynot-travel.pl/wp-content/uploads/2016/12/DSC07113-fb-448x300.jpg 448w" sizes="(max-width: 3872px) 100vw, 3872px" /></a></p>
<p class="p1"><a class="more-link" href="http://www.whynot-travel.pl/?p=989">Read more</a></p>
</div><footer class="entry-footer"><p class="entry-meta"><div class='post-footer-line post-footer-line-2'> <span class="entry-comments-link"><a href="http://www.whynot-travel.pl/?p=989#respond">Leave a Comment</a></span> </div>  <div class='post-footer-line post-footer-line-3'>		  	<span class='post-sharing-icons'>  		<a class='facebook' href="https://www.facebook.com/sharer/sharer.php?u=&t=" title="Share on Facebook" target="_blank"><i class='fa fa-post-footer fa-facebook'></i></a> 	<a class='facebook' href="https://www.youtube.com/channel/UC2e7M5P-uW2qvmQKHcv7agA" title="Check on YT" target="_blank"><i class='fa fa-post-footer fa-youtube'></i></a> 	  		</i></a>           	</span>  </div></p></footer></article><article class="post-976 post type-post status-publish format-standard has-post-thumbnail category-indie tag-backpacker tag-backpacker-life tag-ekscytacja tag-indie tag-love-my-life tag-podroz tag-podroz-z-plecakiem tag-podroz-zycia tag-przed-siebie-w-nieznane tag-reisefieber tag-stress-przed-wyjazdem tag-z-biletem-w-dloni tag-z-plecakiem entry" itemscope="itemscope" itemtype="http://schema.org/BlogPosting" itemprop="blogPost"><header class="entry-header"><h2 class="entry-title" itemprop="headline"><a href="http://www.whynot-travel.pl/?p=976" rel="bookmark">KOLEJNY RAZ OSTATNIA PROSTA, CZYLI JAK TO&nbsp;JEST PRZED&nbsp;WYLOTEM</a></h2>
<p class="entry-meta"><time class="entry-time" itemprop="datePublished" datetime="2016-11-20T22:30:55+00:00">20 listopada 2016</time><span class="entry-categories"><a href="http://www.whynot-travel.pl/?cat=417" rel="category">INDIE</a></span> </p></header><div class="entry-content" itemprop="text"><p>Nie wazne ile podrozujesz &#8211; przed&nbsp;wylotem zawsze pojawia sie stres. Tak zwane reisefieber udziela sie wszystkim. Nawet tym najbardziej zatwardzialym podroznikom z&nbsp;niezliczona iloscia wyjazdow na&nbsp;koncie. Czy spakowalam wszystko? Gdzie jest moj&nbsp;paszport? Do&nbsp;ktorego kartonu wsadzilam bank energii? Nie latwo jest wyzbyc sie nerwow przed&nbsp;wylotem. Czy da sie nad&nbsp;tym zapanowac? Jeszcze kilka wyjazdow i&nbsp;opracujemy recepte.</p>
<p><a class="more-link" href="http://www.whynot-travel.pl/?p=976">Read more</a></p>
</div><footer class="entry-footer"><p class="entry-meta"><div class='post-footer-line post-footer-line-2'> <span class="entry-comments-link"><a href="http://www.whynot-travel.pl/?p=976#respond">Leave a Comment</a></span> </div>  <div class='post-footer-line post-footer-line-3'>		  	<span class='post-sharing-icons'>  		<a class='facebook' href="https://www.facebook.com/sharer/sharer.php?u=&t=" title="Share on Facebook" target="_blank"><i class='fa fa-post-footer fa-facebook'></i></a> 	<a class='facebook' href="https://www.youtube.com/channel/UC2e7M5P-uW2qvmQKHcv7agA" title="Check on YT" target="_blank"><i class='fa fa-post-footer fa-youtube'></i></a> 	  		</i></a>           	</span>  </div></p></footer></article><article class="post-954 post type-post status-publish format-standard has-post-thumbnail category-australia category-azja category-nowa-zelandia tag-backpacking tag-co-czujesz-po-powrocie-z-podrozy-zycia tag-fejm tag-lifestyle tag-opowiesci-z-podrozy tag-podroz-zycia tag-powrot tag-powrot-do-polski tag-spotkania-z-rodzina tag-wszedzie-dobrze-ale-w-podrozy-najlepiej tag-wywiady tag-wyzwania entry" itemscope="itemscope" itemtype="http://schema.org/BlogPosting" itemprop="blogPost"><header class="entry-header"><h2 class="entry-title" itemprop="headline"><a href="http://www.whynot-travel.pl/?p=954" rel="bookmark">BYC TU I&nbsp;TERAZ W&nbsp;POLSCE, czyli o&nbsp;tym co czeka cie po&nbsp;powrocie z&nbsp;podrozy zycia</a></h2>
<p class="entry-meta"><time class="entry-time" itemprop="datePublished" datetime="2016-09-12T09:47:12+00:00">12 wrzesnia 2016</time><span class="entry-categories"><a href="http://www.whynot-travel.pl/?cat=8" rel="category">AUSTRALIA</a> <a href="http://www.whynot-travel.pl/?cat=9" rel="category">AZJA</a> <a href="http://www.whynot-travel.pl/?cat=1" rel="category">NOWA ZELANDIA</a></span> </p></header><div class="entry-content" itemprop="text"><p>Kazdy powrot ma dwie strony medalu. A&nbsp;moze 3, 4, a&nbsp;nawet 5. Przez pierwszy miesiac od&nbsp;powrotu doswiadczylysmy tego doslownie na&nbsp;wlasnej skorze. Kazda inaczej i&nbsp;na swoj sposob. Jesli podrozujesz i&nbsp;czeka Cie powrot &#8211; badz przygotowany. Lepiej wiedziec czego sie spodziewac. Jesli czekasz na&nbsp;kogos &#8211; pomozemy Ci, choc odrobine lepiej zrozumiec, co moze sie dziac w&nbsp;glowie podroznika.</p>
<p><a href="http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687.jpg"><img class="aligncenter size-full wp-image-969" src="http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687.jpg" alt="DSC05687" width="2456" height="1160" srcset="http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687.jpg 2456w, http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687-1059x500.jpg 1059w, http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687-768x363.jpg 768w, http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687-250x118.jpg 250w, http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687-550x260.jpg 550w, http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687-800x378.jpg 800w, http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687-381x180.jpg 381w, http://www.whynot-travel.pl/wp-content/uploads/2016/09/DSC05687-635x300.jpg 635w" sizes="(max-width: 2456px) 100vw, 2456px" /></a></p>
<p><a class="more-link" href="http://www.whynot-travel.pl/?p=954">Read more</a></p>
</div><footer class="entry-footer"><p class="entry-meta"><div class='post-footer-line post-footer-line-2'> <span class="entry-comments-link"><a href="http://www.whynot-travel.pl/?p=954#respond">Leave a Comment</a></span> </div>  <div class='post-footer-line post-footer-line-3'>		  	<span class='post-sharing-icons'>  		<a class='facebook' href="https://www.facebook.com/sharer/sharer.php?u=&t=" title="Share on Facebook" target="_blank"><i class='fa fa-post-footer fa-facebook'></i></a> 	<a class='facebook' href="https://www.youtube.com/channel/UC2e7M5P-uW2qvmQKHcv7agA" title="Check on YT" target="_blank"><i class='fa fa-post-footer fa-youtube'></i></a> 	  		</i></a>           	</span>  </div></p></footer></article><article class="post-939 post type-post status-publish format-standard has-post-thumbnail category-australia category-azja category-nowa-zelandia tag-apteczka-w-podrozy tag-backpackers tag-bagaz-podreczny tag-co-zabrac-w-podroz tag-lista-pakowania tag-pakowanie-przed-podroza-zycia tag-poradnik-pakowania tag-zawartosc-plecaka-podroznika entry" itemscope="itemscope" itemtype="http://schema.org/BlogPosting" itemprop="blogPost"><header class="entry-header"><h2 class="entry-title" itemprop="headline"><a href="http://www.whynot-travel.pl/?p=939" rel="bookmark">Co kobieta powinna spakowac w&nbsp;pierwsza, dluga wyprawe?</a></h2>
<p class="entry-meta"><time class="entry-time" itemprop="datePublished" datetime="2016-08-24T11:48:07+00:00">24 sierpnia 2016</time><span class="entry-categories"><a href="http://www.whynot-travel.pl/?cat=8" rel="category">AUSTRALIA</a> <a href="http://www.whynot-travel.pl/?cat=9" rel="category">AZJA</a> <a href="http://www.whynot-travel.pl/?cat=1" rel="category">NOWA ZELANDIA</a></span> </p></header><div class="entry-content" itemprop="text"><p>Uwaga! dzis bedziemy z&nbsp;Wami bardzo, bardzo szczere! Powiemy wam o&nbsp;doslownie WSZYSTKIM co zabralysmy ze&nbsp;soba w&nbsp;podroz. Co okazalo sie zbedne, czego nam brakowalo i&nbsp;co w&nbsp;miedzyczasie dokupilysmy lub dostalysmy od&nbsp;kogos w&nbsp;prezencie.  Post dedykowany dla pan, ale&nbsp;oczywiscie panowie rowniez znajda cos dla siebie. Wazna sprawa! bazujemy na&nbsp;trasie Nowa Zelandia &#8211; Australia &#8211; Azja poludniowa. Latwo spakowac sie nie bylo, poniewaz klimat troche zroznicowany.</p>
<p><a href="http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885.jpg"><img class="aligncenter size-full wp-image-835" src="http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885.jpg" alt="GOPR0885" width="2000" height="1306" srcset="http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885.jpg 2000w, http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885-766x500.jpg 766w, http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885-768x502.jpg 768w, http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885-250x163.jpg 250w, http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885-550x359.jpg 550w, http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885-800x522.jpg 800w, http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885-276x180.jpg 276w, http://www.whynot-travel.pl/wp-content/uploads/2016/03/GOPR0885-459x300.jpg 459w" sizes="(max-width: 2000px) 100vw, 2000px" /></a></p>
